  return (
    <>
      <Header />
      <FreeBoardLists posts={posts} loading={loading}></FreeBoardLists>{" "}
      <Pagination
        postsPerPage={postsPerPage}
        totalPosts={posts.length}
        paginate={setCurrentPage}
